package com.mimaraslan.controller;

import java.io.File;
import java.io.FileInputStream;
import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;
import java.util.HashMap;
import java.util.Map;
import org.springframework.http.HttpStatus;
import org.springframework.http.ResponseEntity;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.PathVariable;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.RestController;

import com.mimaraslan.exception.ImageNotfoundException;
import com.mimaraslan.model.Image;
import com.mimaraslan.utils.UtilBase64Image;

@RestController
public class ImageController {

	private static Map<Integer, Image> imageRepository = new HashMap<>();
	static {
		Image image = new Image();
		image.setId(1);
		image.setName("demoImage.jpg");
		image.setBase64ImageStringData(
				"");
		image.setImagePath(System.getProperty("user.dir"));
		imageRepository.put(image.getId(), image);
	}

	// STEP 1
	// http://localhost:8080/images
	@RequestMapping(value = "/images")
	public ResponseEntity<Object> getImage() {
		return new ResponseEntity<>(imageRepository.values(), HttpStatus.OK);
	}
	
	
	// STEP 2 - VERSION 1
	// http://localhost:8080/decoder
	@PostMapping("/decoder")
	public String post(@RequestBody Image image) {
		System.out.println("POST request with " + image.toString());

		// save Image to C:\\server folder
		// String path = "C:\\server\\" + image.getName();
		String strUserDir = System.getProperty("user.dir");
		String path = strUserDir + "\\" + image.getName();
		UtilBase64Image.decoder(image.getBase64ImageStringData(), path);
		return "Post Successful!";
	}
	

	// STEP 2 - VERSION 2
	// http://localhost:8080//v2/decoder
	@PostMapping("/v2/decoder")
	public String decoder(@RequestBody Image image) {
		String base64Image = image.getBase64ImageStringData();
		String pathFile = image.getImagePath() + "\\" + image.getName();
		String result = "Fail";
		try (FileOutputStream imageOutFile = new FileOutputStream(pathFile)) {
			// Converting a Base64 String into Image byte array
			byte[] imageByteArray = Base64.getDecoder().decode(base64Image);
			imageOutFile.write(imageByteArray);
			result = "Post Successful!";
		} catch (FileNotFoundException e) {
			System.out.println("Image not found" + e);
			result = "Image not found: " + e;
		} catch (IOException ioe) {
			System.out.println("Exception while reading the Image " + ioe);
			result = "Exception while reading the Image: " + ioe;
		}
		return result;
	}
	
	
	// STEP 3 - VERSION 1
		// http://localhost:8080/encoder?name=demoImage.jpg
		@GetMapping(value = "/encoder")
		public Image get(@RequestParam("name") String name) {
			System.out.println(String.format("GET info: imageName = %s", name));
			// String imagePath = "C:\\server\\" + name;
			String imagePath = System.getProperty("user.dir") + "\\" + name;

			String imageBase64 = UtilBase64Image.encoder(imagePath);

			if (imageBase64 != null) {
				//	Image image = new Image(name, imageBase64);
				Image image = new Image(name, imagePath, imageBase64);
				return image;
			}
			return null;
		}

		// STEP 3 - VERSION 2
		// http://localhost:8080/v2/encoder?name=demoImage.jpg
		@RequestMapping(value = "/v2/encoder", method = RequestMethod.GET)
		public Image encoder(String name) {
			String imagePath = System.getProperty("user.dir") + "\\" + name;
			File file = new File(imagePath);
			try (FileInputStream imageInFile = new FileInputStream(file)) {
				// Reading a Image file from file system
				byte imageData[] = new byte[(int) file.length()];
				imageInFile.read(imageData);
				String imageBase64 = Base64.getEncoder().encodeToString(imageData);
				if (imageBase64 != null) {
					Image image = new Image(name, imagePath, imageBase64);
					return image;
				}
			} catch (FileNotFoundException e) {
				System.out.println("Image not found" + e);
			} catch (IOException ioe) {
				System.out.println("Exception while reading the Image " + ioe);
			}
			return null;
		}

	
	
	@RequestMapping(value = "/images/{id}", method = RequestMethod.DELETE)
	public ResponseEntity<Object> delete(@PathVariable("id") Integer id) {
		imageRepository.remove(id);
		return new ResponseEntity<>("Image is deleted successsfully", HttpStatus.OK);
	}

	@RequestMapping(value = "/images/{id}", method = RequestMethod.PUT)
	public ResponseEntity<Object> updateImage(@PathVariable("id") Integer id, @RequestBody Image image) {
		if (!imageRepository.containsKey(id))
			throw new ImageNotfoundException();
		imageRepository.remove(id);
		image.setId(id);
		imageRepository.put(id, image);
		return new ResponseEntity<>("Image is updated successfully", HttpStatus.OK);
	}

	@RequestMapping(value = "/images", method = RequestMethod.POST)
	public ResponseEntity<Object> createImage(@RequestBody Image image) {
		imageRepository.put(image.getId(), image);
		return new ResponseEntity<>("Image is created successfully", HttpStatus.CREATED);
	}


}